import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
// import AddedExpense from "./AddedExpense";

function ListOfAddedExpenses(props) {
  const addedExpenseList = props.expenseArray(item => (
    <ListOfAddedExpenses key={item.id} completedExpense={item} />
  ));
  return (
    <table>
      <thead>
        <tr>
          <th>Type</th>
          <th>Name</th>
          <th>Date</th>
          <th>Amount</th>
        </tr>
      </thead>
      <tbody>
        <tr>
          <td>{props.completedExpense}</td>
          <td>Name</td>
          <td>Date</td>
          <td>Amount</td>
        </tr>
      </tbody>
    </table>
  );
}

export default ListOfAddedExpenses;
